import React from 'react'
import { useContext } from 'react'
import noteState from '../Context/Notes/noteState'

const About = () => {
    const a = useContext(noteState);
    return (
        <div>
            My name is {a.name} and my branch is {a.branch}
        </div>
    )
}

export default About
